import React, { Component } from 'react';

class NotePreview extends Component {

  render(){
    console.log("Rendering preview: " + localStorage[this.props.ID])
    return(
      <button className=" row row-100" onClick={this.props.onClick(this.props.ID)}>
        {localStorage[this.props.ID]}
      </button>
    )
  }
}

export default NotePreview;
